import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";

let styles = {
    margin: 'auto',
    width: '300px',
  };

function RewramsCarousel() {
  return (
	<div style={styles}>
		<Carousel>
			<div className='carousel-image-container'>
				<img src={require('../../images/1-customer-shares-story.jpg')} alt="Hong Kong" />
				<p className="legend">1. Customer shares story</p>
			</div>
			<div>
				<img src={require('../../images/2-customer-receives-code.png')}alt="Singapore"/>
				<p className="legend">2. Customer receives code</p>
			</div>
			<div>
				<img src={require('../../images/4-customers-friend-gets-interested.png')} alt="Japan"/>
				<p className="legend">3. Customer pays</p>
			</div>
			<div>
				<img src={require('../../images/1-customer-shares-story.jpg')} alt="Las Vegas"/>
				<p className="legend">4. Customer's friend gets interested</p>
			</div>
		</Carousel>
	</div>
  );
}

export default RewramsCarousel;
